		private static List<Integer> readStopLengthFromFile() {
			String fileName = Constants.outputStopPointFilePrefix+Constants.BB+".txt";			
			ArrayList<Integer> stopTimeList = new ArrayList<Integer>();
			try (BufferedReader br = new BufferedReader(new FileReader(fileName ))) {
				String line;
				while ((line = br.readLine()) != null) {
					// process the line.
					Scanner sc = new Scanner(line);		    	
					sc.nextDouble();
					sc.nextDouble();
					int stopTime = sc.nextInt();
					stopTimeList.add(stopTime);
					sc.close();
				}
				System.out.println("Printing all the stoptimes \n"+stopTimeList.toString());

			} catch (IOException e) {				
				e.printStackTrace();
			}	
			return stopTimeList;	

		}
